Static variables and register variables are two types of variables in C programming language.

1. Static Variables:
A static variable is a variable that has been allocated statically, i.e., at compile time. It retains its value between function calls and is initialized only once. Static variables are declared using the keyword "static".

There are two types of static variables in C:

a. Static Local Variables:
A static local variable is a variable that is declared inside a function with the keyword "static". It is initialized only once and retains its value between function calls.

Example:
```c
#include <stdio.h>

void increment() {
    static int count = 0;
    count++;
    printf("Count: %d\n", count);
}

int main() {
    increment();
    increment();
    increment();
    return 0;
}
```
Output:
```
Count: 1
Count: 2
Count: 3
```

b. Static Global Variables:
A static global variable is a variable that is declared outside of any function with the keyword "static". It is visible only within the file in which it is declared and retains its value between function calls.

Example:
```c
#include <stdio.h>

static int count = 0;

void increment() {
    count++;
    printf("Count: %d\n", count);
}

int main() {
    increment();
    increment();
    increment();
    return 0;
}
